def find_ reversals(input_list):
    """
    This function checks the number of reversals needed to sort the given list using quicksort.
    """
    def quicksort(sublist):
        if len(sublist) <= 1:
            return sublist, 0

        pivot = sublist[len(sublist) // 2]
        left, left_reversals = quicksort( [ x for x in sublist[:len(sublist) // 2] if x[0] <= pivot] )
        right, right_reversals = quicksort( [ x for x in sublist[len(sublist) // 2:] if x[0] >= pivot] )
        return [ left + [pivot] + right], left_reversals + right_reversals + (len(sublist) // 2)

